describe('Simple example without external dependencies', () => {
  test('Returns the last element', () => {
    const arr = [1, 2, 3];
    expect(arr.last()).toEqual(3);
  });

  test('Returns -1 for an empty array', () => {
    const arr = [];
    expect(arr.last()).toEqual(-1);
  });

  test('Returns the last element for arrays with mixed types', () => {
    const arr = [true, {}, 'hello', 42];
    expect(arr.last()).toEqual(42);
  });
});
